import Header from "./components/Header/Header";
import MealsSummary from "./components/Meals/MealsSummary/MealsSummary";
import AvailableMeals from "./components/Meals/AvailableMeals/AvailableMeals";
import CartItems from "./store/cart-items";

function App() {
    return (
        <CartItems.Provider value={[]}>
            <Header/>
            <main>
                <MealsSummary/>
                <AvailableMeals/>
            </main>
        </CartItems.Provider>
    );
}

export default App;
